import React, { Component } from "react";
import Card from "../Card/Card";
import "./estilos.css";
import CardVerso from "../CardVerso/CardVerso"

class Visitante extends Component {
    constructor(props){
        super(props)
    }

    render() {
        
        if(this.props.carta==null){
            return null
        }
        else if(!this.props.visivel){
            return(
                <CardVerso classe='grande'/>
            )
        }
        else{

            return (
                <section  key={this.props.carta.id}>
    
                    <Card
                        efeitoCartas={this.props.efeitoCartas}
                        bandeira={this.props.carta.bandeira}
                        id={this.props.carta.id}
                        país={this.props.carta.país} idh={this.props.carta.idh} exp={this.props.carta.exp} />
                </section>
            )
        }

    }
    

}

export default Visitante;
